import React from "react";
import HeaderLogedin from "../components/headerLogedin";
import { Box, Divider, Paper, Stack, Typography } from "@mui/material";
import Grid from "@mui/material/Grid";

export default function Profile() {
  const ContainerStyle = {
    marginTop: "20px",
    marginBottom: "50px",
    padding: "20px",
    backgroundColor: "#F0F0F0",
  };
  const ColumnStyle = {
    backgroundColor: "white",
    borderRadius: "3px",
    marginBottom: "5px",
    justifyContent: "flex-end",
    padding: "30px",
    alignItems: "center",
  };

  return (
    <>
      <HeaderLogedin />
      <Divider sx={{ marginTop: "80px" }} />
      <Paper sx={ContainerStyle} elevation={5}>
        <Grid sx={{ height: "600px" }} container spacing={0}>
          <Grid item xs={6} md={9} sx={{ paddingLeft: "5px" }}>
            <Box sx={ColumnStyle}></Box>
          </Grid>
          <Grid item xs={6} md={3}>
            <Stack direction="row" sx={ColumnStyle}>
              <Box>
                <Typography variant="h5">به پلاک ۲۶ خوش آمدید</Typography>
                <Typography sx={{ mt: "10px", textAlign: "left" }} variant="h5">
                  ۰۹۱۲۴۳۵۶۶۸۸
                </Typography>
              </Box>

              <img
                style={{
                  width: "50px",
                  height: "50px",
                  marginLeft: "20px",
                  borderRadius: "100px",
                }}
                src={require("../assets/images/Profile.png")}
              />
            </Stack>
            <Stack direction="row" sx={ColumnStyle}>
              <Box>
                <Typography variant="body1">به پلاک ۲۶ خوش آمدید</Typography>
              </Box>

              <img
                style={{
                  width: "50px",
                  height: "50px",
                  marginLeft: "20px",
                  borderRadius: "100px",
                }}
                src={require("../assets/images/Profile.png")}
              />
            </Stack>
          </Grid>
        </Grid>
      </Paper>
    </>
  );
}
